<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>You've met with a terrible fate, haven't you?</title>
<style>
  @import url('https://fonts.googleapis.com/css2?family=Press+Start+2P&display=swap');

  * { margin: 0; padding: 0; box-sizing: border-box; }

  body {
    background: #000;
    width: 100vw;
    height: 100vh;
    overflow: hidden;
    cursor: none;
    font-family: 'Press Start 2P', monospace;
  }

  #ben {
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    max-height: 70vh;
    max-width: 60vw;
    opacity: 0;
    transition: opacity 4s ease-in;
    z-index: 1;
    image-rendering: pixelated;
  }

  #ben.visible {
    opacity: 1;
  }

  #dialogue-box {
    position: fixed;
    bottom: 32px;
    left: 50%;
    transform: translateX(-50%);
    width: min(700px, 90vw);
    background: #000;
    border: 4px solid #fff;
    box-shadow:
      0 0 0 2px #000,
      0 0 0 6px #fff,
      0 0 0 8px #000,
      0 0 20px rgba(255,255,255,0.15);
    padding: 24px 28px 28px;
    z-index: 10;
    opacity: 0;
    transition: opacity 0.3s;
    display: none;
  }

  #dialogue-box.visible {
    opacity: 1;
    display: block;
  }

  #dialogue-name {
    color: #ffe066;
    font-size: 9px;
    letter-spacing: 2px;
    margin-bottom: 14px;
    text-transform: uppercase;
  }

  #dialogue-text {
    color: #fff;
    font-size: 10px;
    line-height: 2;
    min-height: 60px;
    letter-spacing: 1px;
  }

  #dialogue-cursor {
    display: inline-block;
    width: 10px;
    height: 10px;
    background: #fff;
    margin-left: 4px;
    animation: blink 0.7s step-end infinite;
    vertical-align: middle;
  }

  #dialogue-cursor.hidden {
    display: none;
  }

  #press-enter {
    text-align: right;
    color: #aaa;
    font-size: 7px;
    margin-top: 14px;
    animation: blink 1.1s step-end infinite;
  }

  #press-enter.hidden {
    display: none;
  }

  @keyframes blink {
    0%, 100% { opacity: 1; }
    50% { opacity: 0; }
  }

  /* Subtle scanline overlay */
  body::after {
    content: '';
    position: fixed;
    inset: 0;
    background: repeating-linear-gradient(
      to bottom,
      transparent,
      transparent 2px,
      rgba(0,0,0,0.08) 2px,
      rgba(0,0,0,0.08) 4px
    );
    pointer-events: none;
    z-index: 100;
  }

  /* Vignette */
  body::before {
    content: '';
    position: fixed;
    inset: 0;
    background: radial-gradient(ellipse at center, transparent 40%, rgba(0,0,0,0.85) 100%);
    pointer-events: none;
    z-index: 99;
  }
</style>
</head>

<script>
const dialogues = [
  { name: "???",      text: "You shouldn't have come here." },
  { name: "???",      text: "I've been waiting.\u2003A very long time." },
  { name: "???",      text: "You can't leave.\u2003You know that, don't you?" },
  { name: "B E N",   text: "You shouldn't have done that." },
  { name: "B E N",   text: "." },
];

let currentLine = 0;
let typing = false;
let typeInterval = null;
let typingDone = false;

const box       = document.getElementById('dialogue-box');
const nameEl    = document.getElementById('dialogue-name');
const innerEl   = document.getElementById('dialogue-inner');
const cursor    = document.getElementById('dialogue-cursor');
const pressEnter= document.getElementById('press-enter');
const ben       = document.getElementById('ben');
const bgm       = document.getElementById('bgm');

function typeLine(text, onDone) {
  innerEl.textContent = '';
  cursor.classList.remove('hidden');
  pressEnter.classList.add('hidden');
  typingDone = false;
  typing = true;
  let i = 0;
  typeInterval = setInterval(() => {
    if (i < text.length) {
      innerEl.textContent += text[i];
      i++;
    } else {
      clearInterval(typeInterval);
      typing = false;
      typingDone = true;
      cursor.classList.add('hidden');
      pressEnter.classList.remove('hidden');
      if (onDone) onDone();
    }
  }, 60);
}

function showLine(index) {
  if (index >= dialogues.length) return;
  const d = dialogues[index];
  nameEl.textContent = d.name;
  typeLine(d.text, () => {
    if (index === 4) {
      // BEN fades in after last line finishes typing
      setTimeout(() => { ben.classList.add('visible'); }, 500);
    }
  });
}

function startDialogue() {
  box.style.display = 'block';
  requestAnimationFrame(() => box.classList.add('visible'));
  showLine(0);
}

box.addEventListener('click', () => {
    if (typing) {
      clearInterval(typeInterval);
      typing = false;
      typingDone = true;
      innerEl.textContent = dialogues[currentLine].text;
      cursor.classList.add('hidden');
      pressEnter.classList.remove('hidden');
      if (currentLine === 4) {
        setTimeout(() => { ben.classList.add('visible'); }, 500);
      }
    } else if (typingDone) {
      currentLine++;
      if (currentLine < dialogues.length) {
        showLine(currentLine);
      }
    }
  });

document.addEventListener('keydown', (e) => {
  if (e.key === 'Enter') {
    if (typing) {
      // Skip to end of current line
      clearInterval(typeInterval);
      typing = false;
      typingDone = true;
      innerEl.textContent = dialogues[currentLine].text;
      cursor.classList.add('hidden');
      pressEnter.classList.remove('hidden');
      if (currentLine === 4) {
        setTimeout(() => { ben.classList.add('visible'); }, 500);
      }
    } else if (typingDone) {
      currentLine++;
      if (currentLine < dialogues.length) {
        showLine(currentLine);
      }
    }
  }
});

// Start everything after page load
window.addEventListener('load', () => {
  bgm.volume = 0.75;
  bgm.play().catch(() => {
    // Autoplay blocked  start on first interaction
    document.addEventListener('click', () => bgm.play(), { once: true });
    document.addEventListener('keydown', () => bgm.play(), { once: true });
  });

  setTimeout(startDialogue, 5000);
});
</script>
</body>
</html>
